import { RiPaintBrushFill } from "react-icons/ri";

function Nav(): JSX.Element {
  return (
    <nav>
      <h1>
        <RiPaintBrushFill style={{ marginRight: "10px", color: "#007bff" }} />
        Dave's Decor
      </h1>
      <ul>
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default Nav;
